import styled from "styled-components"

const Button = styled.button`
  background: #4239cd;
  border-radius: 3px;
  border: 2px solid #4239cd;
  color: white;
  margin: 0 1em;
  padding: 0.25em 1em;
  min-width:150px;
  min-height:40px;
`
export default props=>{
    return(<Button {...props}></Button>)
}
